import { useEffect } from "react";
 import axios from "axios";

// axios でリクエスト送信
const Example = () => {
  useEffect(() => {
    axios.get('http://localhost:3003/user').then((res)=> {
      console.log(res.data);
    });
  })
  return <></>;
};

export default Example;
